      {/* Video de fondo */}
      <video
        autoPlay
        loop
        muted
        className="absolute inset-0 w-full h-full object-cover z-0 opacity-75"
      >
        <source src="https://www.w3schools.com/html/mov_bbb.mp4" type="video/mp4" /> {/* Reemplaza con tu URL de video */}
        Tu navegador no soporta la etiqueta de video.
      </video>

      {/* Contenido principal */}
      <div className="relative z-10">
        <HomeContent />
      </div>
    </div>
  );
}
